import React, { useEffect, useState } from 'react'
import { Table } from 'react-bootstrap'

function AllStudents() {
    const[users,setUsers] = useState([])

    const userData = async() =>{
        try{
            const res = await fetch('/api/user/getAllStudents',{
                method:"GET",
                headers:{
                    "Content-Type": "application/json"
                },
            });
            const data = await res.json();
            console.log(data);
            setUsers(data);
        }catch(err){
            console.log(err);
        }
    }

    useEffect(()=>{
        userData();
    },[])
  return (
    <>
        <Table>
            <thead>
                <tr>
                    <th>Registraion Number</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Mobile Number</th>
                    <th>Edit/Delete</th>
                </tr>
            </thead>
            <tbody>
                {users && 
                users.map((user)=>(
                    <tr key={user._id}>
                        <td>{user.registration_no}</td>
                        <td>{user.name}</td>
                        <td>{user.email}</td>
                        <td>{user.mobile}</td>
                        <td>edit/delete</td>
                    </tr>
                ))}
            </tbody>
        </Table>
    </>
  )
}

export default AllStudents
